var Media = function(fileName, successCB, errorCB, statusCB, mockConditions){

	this.src = fileName;
    this.successCallback = successCB;
    this.errorCallback = errorCB;
    this.statusCallback = statusCB;
    this.duration = -1;
    this.position = -1;

 	// Media.MEDIA_NONE = 0;
	// Media.MEDIA_STARTING = 1;
	// Media.MEDIA_RUNNING = 2;
	// Media.MEDIA_PAUSED = 3;
	// Media.MEDIA_STOPPED = 4;


	this.getCurrentPosition = function(position){
		this.position = position;
		return this.position;
	}

	this.getDuration = function(){
		this.duration = 5;
		return this.duration;
	}

	this.play = function(){
		this.statusCallback(2);
	}

	this.pause = function(){
		this.statusCallback(3);
	}

	this.release = function(){

	}

	this.seekTo = function(){

	}

	this.setVolume = function(){

	}

	this.startRecord = function(){
		this.statusCallback(2);
	}

	this.stopRecord = function(){
		this.statusCallback(4);
	}

	this.stop = function(){
		this.statusCallback(4);
	}

	
};

